schemas.content:
type Payload {
  message: String!
}

type Account {
  accountId: String!
  username: String!  
}

type LoginPayload {
  message: String!
  token: String
}

type MePayload {
  message: String!
  account: Account
}

type Query {
  dummy: Int
  me: MePayload
}

type Mutation {
  dummy: Int
  login(username: String!, password: String!): LoginPayload
  register(username: String!, password: String!): Payload
  changePassword(username: String!, password: String!, newPassword: String!): Payload
}

type Subscription {
  dummy: Int
}

schema {
  query: Query
  mutation: Mutation
  subscription: Subscription
}
